    <script src="https://cdnjs.cloudflare.com/ajax/libs/pdf.js/2.0.943/pdf.min.js" type="text/javascript"></script>
    <script src="../scripts/pdfviewer.php"></script>
    <script>
      function loadPDF(name) {
          pdfViewerState.renderElementId="pdf_renderer";
          pdfViewerState.currentPageId="pdf_current_page";
          pdfViewerState.zoomInId="pdf_zoom_in";
          pdfViewerState.zoomOutId="pdf_zoom_out";
          pdfViewerState.prevPgId="pdf_go_previous";
          pdfViewerState.nextPgId="pdf_go_next";
          pdfViewerState.tries=1;
          pdfViewerState.timeoutDelay=3000;
          const pdfRenderEl=document.getElementById("pdf_renderer");
          pdfRenderEl.onrender=function() {
              pdfRenderEl.onrender=null;
          }
          viewPDF(name);
      }
      function submitPrint() {
          let pdfFrame=document.getElementById("pdf_print_area");
          if (pdfFrame.contentWindow) pdfFrame.contentWindow.print();
      }
      function atajoImpresion(evt) {
          if (evt.ctrlKey && evt.keyCode==80) {
              submitPrint();
              return false;
          }
          return true;
      }
      document.onkeydown=atajoImpresion;
    </script>
  </head>
  <body onload="loadPDF('cfdiTest2.pdf');">
    <h1>PDF VIEWER TEST</h1>
    <div id="pdf_container">
      <div id="pdf_canvas_container">
          <canvas id="pdf_renderer"></canvas>
      </div>
      <div id="pdf_controls">
          <div id="pdf_zoom_controls">
              <button id="print_button" type="button" onclick="submitPrint();" class="pdf_button"/>
              <button id="pdf_zoom_in" type="button" onclick="changeZoom(0.2);" class="pdf_button" title="120%"/>
              <button id="pdf_zoom_out" type="button" onclick="changeZoom(-0.2);" class="pdf_button" title="80%"/>
          </div>
          <div id="pdf_navigation_controls">
              <button id="pdf_go_previous" type="button" onclick="changePage(-1);" class="pdf_button"> </button>
              <input id="pdf_current_page" value="1" min="1" type="number" onkeypress="setPage(event);" />
              <button id="pdf_go_next" type="button" onclick="changePage(+1);" class="pdf_button" />
          </div>
          <div id="pdf_clear_controls"></div>
      </div>
      <iframe id="pdf_print_area" src="cfdiTest2.pdf"></iframe>
  </body>
</html>
